import { Box, Center, Container, HoverCard } from "@mantine/core";
import React from "react";
import { IconAlignLeft, IconSearch, IconPhotoMinus } from "@tabler/icons-react";
const AppBar = () => {
  return (
    <div>
      <Container fluid bg="var(--mantine-color-blue-light)">
        <Center>App Bar</Center>
      </Container>
     <Box my="xs" className="bg-white rounded-lg p-4">
  <div className="flex justify-between items-end">
    <div className="items-start">
      <IconAlignLeft />
    </div>
    <div className="inline-block">
      <IconSearch className="inline-block" />
      <IconPhotoMinus className="inline-block" />
    </div>
  </div>
</Box>

    </div>
  );
};

export default AppBar;
